import React, { Component } from "react";
import FoodtruckInput from "../components/FoodtruckInput";
import Foodtruck from "../components/Foodtruck";
import Account from "../components/Account";

class FoodtruckContainer extends Component {
  render() {
    return (
      <div>
        <FoodtruckInput />
        <Foodtruck foodtrucks={ Account.food_trucks}/>
      </div>
    );
  }
}

export default FoodtruckContainer;
